The next part of the flow is: When the user selects a server to connect to in the UI, it calls the GetConfig to get a VPN configuration for this server. This function transitions the state machine multiple times. The client uses these state transitions for logging or even updating the UI. The client then connects Let's try it, the required arguments are the same for adding a config in the Python wrapper: print(common.get_config(edu.ServerType.INSTITUTE_ACCESS, "https://demo.eduvpn.nl")) However, this gives an exception: eduvpn_common.main.WrappedError: fsm failed transition from 'Request_Config' to 'Ask_Profile', is this required transition handled? A similar error to the OAuth error we had before. This Ask_Profile transition is there for the client/user to choose a profile as this server has multiple profiles defined. To handle this transition and thus choose a profile to continue, we must do multiple steps: Add the condition to the transitions class Parse the data that we get back Reply with a choice for the profile If we add the condition and print the data: @class_state_transition(State.ASK_PROFILE, StateType.ENTER)
def enter_ask_profile(self, old_state: State, data: str): print("profiles:", data) we get back the following JSON (from the Go docs: The data for this transition is defined in types/server/server.go RequiredAskTransition with embedded data Profiles in types/server/server.go): { "cookie": 4, "data": { "map": { "internet": { "display_name": { "en": "Internet" }, "supported_protocols": [ 1, 2 ] }, "internet-split": { "display_name": { "en": "No rfc1918 routes" }, "supported_protocols": [ 1, 2 ] } }, "current": "" }
} This thus gives you the list of profiles with a so-called "cookie". This cookie is used to confirm the choice to the Go library. To do so we must do the following to handle this: import json # Do this inside the Transitions class
@class_state_transition(State.ASK_PROFILE, StateType.ENTER)
def enter_ask_profile(self, old_state: State, data: str): # parse the json json_dict = json.loads(data) self.common.cookie_reply(json_dict["cookie"], "internet") If we then re-run the code, we get back the following JSON (from the Go docs: The return data is the configuration, marshalled as JSON and defined in types/server/server.go Configuration) { "config": "the WireGuard config", "protocol": 2, # 2 specifies WireGuard "default_gateway": true
}

