Signature: func Register( name *C.char, version *C.char, configDirectory *C.char, cb C.StateCB, debug C.int,
) *C.char Register creates a new client and also registers the FSM to go to the initial state Name is the name of the client, must be a valid client ID. Version is the version of the client. This version field is used for the user agent in all HTTP requests. cb is the state callback. It takes three arguments: The old state, the new state and the data for the state as JSON. Note that the states are defined in client/fsm.go, e.g. Main (in Go: StateMain), ASK_PROFILE (in Go: StateAskProfile) This callback returns non-zero if the state transition is handled. This is used to check if the client handles the needed transitions debug, if non-zero, enables debugging mode for the library, this means: Log everything in debug mode, so you can get more detail of what is going on Write the state graph to a file in the configDirectory. This can be used to create a FSM png file with mermaid https://mermaid.js.org/ After registering, the FSM is initialized and the state transition MAIN should have been completed If some error occurs during registering, it is returned as a types/error/error.go Error Example Input: Register("org.eduvpn.app.linux", "0.0.1", "/tmp/eduvpn-common", myCallbackFunc, 1) Example Output: { "message": { "en": "failed to register, a VPN state is already present" }, "misc": false
}
